import React from "react";
import "./Home.css"
import Header from "../components/Header";

export default function Home() {

  return (
    <div className="home mx-auto" id="home">
      <Header title={"Colbe Roberson"} caption={"Hi, thanks for visiting my online portfolio!  My name is Colbe Roberson.  I'm currently a computer science student at the New Jersey Institute of Technology.  I have an interest in various fields of computer science and programming."}/>
    </div>
  )
}
